import React from "react";
import "../scss/footer.scss";

import Logo from "../assets/logo-queensland.png";

const Footer = () => {
  const strings = ['Help', 'Copyright', 'Disclaimer', 'Privacy', 'Right to information', 'Accessibility', 'Jobs in Queensland Goverment', 'Tagalog (Other languages)']

  return (
    <>
      <div className="footer-desktop">
        <div className="footer-logo">
          <img src={ Logo } alt="" />
        </div>

        <div className="footer-title">
          <strong>Queensland</strong> Goverment
        </div>
      </div>

      <div className="footer-mobile-ext">
        {
          strings.map((str) => (
            <p>{{ str }}</p>
          ))
        }
      </div>
    </>
  );
}

export default Footer;
